import { useEffect ,useState} from "react";
import { loadScript, publicUrlFor } from "../../../../../globals/constants";
import JobZImage from "../../../../common/jobz-img";
import CountUp from "react-countup";
import { publicUser } from "../../../../../globals/route-names";
import { NavLink } from "react-router-dom";

function Home1Page() {

    useEffect(() => {
        loadScript("js/custom.js");
    })

    const [jobs, setJobs] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);
  const [counts, setCounts] = useState({
    candidates: 0,
    employers: 0,
    postjobs: 0
  });
  const [stats, setStats] = useState({
    totalCandidates: 0,
    totalEmployers: 0,
    totalVacancies: 0,
  });

  useEffect(() => {
    const fetchStats = async () => {
      try {
        const [candidatesRes, employersRes, vacanciesRes] = await Promise.all([
          fetch('http://localhost:8080/total-candidates').then((res) => res.json()),
          fetch('http://localhost:8080/total-employers').then((res) => res.json()),
          fetch('http://localhost:8080/total-vacancies').then((res) => res.json()),
        ]);

        if (candidatesRes.success && employersRes.success && vacanciesRes.success) {
          setStats({
            totalCandidates: candidatesRes.totalCandidates,
            totalEmployers: employersRes.totalEmployers,
            totalVacancies: vacanciesRes.totalVacancies,
          });
        }
      } catch (error) {
        console.error('Error fetching stats:', error);
      }
    };

    fetchStats();
  }, []);


  useEffect(() => {
    const fetchCounts = async () => {
      try {
        const response = await fetch(`http://localhost:8080/counts`);
        const data = await response.json();
        if (data.success) {
          setCounts(data.data);
        } else {
          console.error("Failed to fetch counts:", data.message);
        }
      } catch (error) {
        console.error("Error fetching counts:", error);
      }
    };

    fetchCounts();
  }, []);

  useEffect(() => {
    const fetchLatestJobs = async () => {
      try {
