        }
        const data = await response.json();
        if (data.success) {
          setJobs(data.data);
        } else {
          setError(`Failed to fetch jobs: ${data.message}`);
        }
      } catch (error) {
        setError(`Error fetching jobs: ${error.message}`);
      } finally {
        setLoading(false);
      }
    };

    fetchLatestJobs();
